  false,\n\t\"url\": null,\n\t\"notes\": \"The report contains the data gathered at
  Ocean Station \"P\" in late June and early July of 1971 on the \"SUBARCTIC-A\" cruise
  of R/V YAQUINA. The data include: 1) temperature, salinity, and oxygen profiles;
  2) estimates of zooplankton displacement volumes at different depths; and 3) estimates
  of numerical density of many zooplankton species or \"categories\". Interpretations
  of the data will be presented in a paper to be published in Limnology and Oceanography.\",\n\t\"license_title\":
